import React from 'react'
import {Button,Card} from "react-bootstrap";


function Dish({dish}){

  return(
    <>
      <Card className="my-3 p-3 rounded h-90">
        <Card.Img style={{objectFit :"contain"}} variant="top" src={Dish.picture} />
        <Card.Body>
          <Card.Title>
          {`${dish.dish_name}`}
          </Card.Title>
          <Card.Subtitle className="mb-2 text-muted">Ingredients</Card.Subtitle>
          </Card.Body>
      </Card>
    </>
  )

}


export default Dish;
